import React from "react";
import './PersonalInfo.css'

function PersonalInfo() {
    return (
        <div className="PersonalInfo">
            <h1 className="PersonalInfo-text">Personal Info</h1>
            <p className="PersonalInfo-text">FirstName:</p>
            <input type="text" className="PersonalInfo-input" name="fName" defaultValue="阳"/>
            <p className="PersonalInfo-text">Last Name:</p>
            <input type="text" className="PersonalInfo-input" name="lName" defaultValue="易"/><br/>
            <input type="submit" className="PersonalInfo-input"/>
        </div>
    );
}

const firstName = document.getElementsByName("fName")
const lastName = document.getElementsByName("lName")


export default PersonalInfo
